- Danos as unidades residenciais, principalmente as construídas em madeira, que deverão ser reformadas para o retorno das famílias;

- Inundação de Unidades de saúde, comprometendo o atendimento assistencial e comprometimento da infraestrutura física da unidade e ainda, dos materiais disponíveis para atendimento ao público;

- Comprometimento das vias de acesso aos bairros e de circulação interna.

- 07 unidades habitacionais destruídas pela força das águas;

- 28 unidades habitacionais danificadas pela força das águas;

- 01 praça que servia de área de recreação para a comunidade que ficou completamente destruída e 01 quadra tipo arena;

- Houve ainda a destruição da rua da orla, deixando ainda aproximadamente 1.350 m de ruas destruídas.

* Dados ainda incalculados, porém temos grande redução e secagem de açudes, riachos, poços artesianos e capitação de água da CAEMA;

* redução constantemente  na produção agrícola;

* paralização de construções públicas e privadas.

As unidades de ensino localizada na zona rural tiveram suas estruturas comprometidas devido a força da enxurrada;

Uma unidade de atendimento social localizada na área urbana sofreu avarias;

uma área que servia de lazer para a comunidade do bairro surubim foi destruída;

Quatro áreas de lazer, praças encontram-se danificadas devido a sujeira e entulhos trazidos pela enxurrada;

Unidades habitacionais localizada na área rural destruídas e 10 unidades localizadas na urbana tiveram suas estruturas comprometidas.

Pontes localizadas na área rural foram arrastadas com a força da enxurrada. Existe ainda aproximadamente 103 km de estradas vicinais praticamente intrafegáveis.

EM CONSEQUÊNCIA DAS FORTES CHUVAS QUE OCORRERAM NO MUNICÍPIO NOS ÚLTIMOS 60 DIAS, CAUSANDO DESTRUIÇÃO E DANIFICAÇÕES DE DIVERSAS PONTES, BUEIROS, GALERIAS E ESTRADAS QUE FORAM CORTADAS E INTERROMPENDO TOTALMENTE A PASSAGEM ,INCLUSIVE DOS ÔNIBUS DO TRANSPORTE ESCOLAR, ELENCAMOS ABAIXO OS PRINCIPAIS DANOS MATERIAIS:

- PRODUTORES DE LEITE E DA AGRICULTURA FAMILIAR NÃO ESTÃO CONSEGUINDO ESCOAR AS PRODUÇÕES, GERANDO PREJUÍZOS;

- ALUNOS PERDENDO AULAS, GERANDO PREJUÍZOS INTELECTUAIS IMENSURÁVEIS;

- IMPEDIMENTO DE TRÂNSITO POR VIA TERRESTRE,OCASIONANDO O DESCONFORTO DE PASSAR POR CAMINHOS MAIS DISTANTES.

- ISOLAMENTO DE COMUNIDADES.

