Foram muitos prejuízos causados pelo desastre. Dentre os mais consideráveis estão:
9(nove) Pontes de Madeira Totalmente Destruídas;
10 (dez) Pontes Parcialmente Destruídas;
13 (treze) Bueiros com Manilhas Totalmente Destruídos;
