Dentre os principais problemas podemos destacar:
¿	Cabeceiras de pontes e pontes danificadas ou arrastadas pelas constantes enchentes;
¿	Árvores e ribanceiras caindo em meio as estradas;
¿	Remoção da camada de piçarra/cascalho nas elevações tornando-se escorregadias e inacessíveis em dias chuvosos;
¿	Abertura de grandes valas/crateras nas encostas causadas pela erosão;
¿	Alagamentos nas áreas mais baixas das estradas e ramais;
¿	Atoleiros ocasionados pelo amolecimento do solo;
¿	Estradas e vicinais intrafegáveis e sem acesso.

- Em consequências das fortes chuvas e a crescente das águas que causaram alagamentos, residências foram danificadas, madeiras estragadas, tábuas arrancadas com a força das águas e telhado arrancado com a força dos ventos, necessitando de recursos para atender as demandas;
- Algumas Unidades de Ensino encontram-se danificadas e em risco de desabamento pelas fortes chuvas e a enchente que ocorrem na região, comprometimento em toda sua estrutura física necessitando de reparos e/ou até mesmo de novas obras; 
- Devido a força da água das chuvas que causam enxurradas, 10 pontes foram danificadas e 02 destruídas, necessitando de recursos financeiros para recucperá-las e construir novas pontes.
- Na área rural as vicinais ficaram intransitáveis pois são muitos os pontos de atoleiros que necessitam ser recuperados.

Em consequência das fortes chuvas que ocorreram no município nos últimos 90 dias, principalmente na última semana, causando destruição e danificações de diversas pontes, bueiros, galerias e estradas que foram cortadas e interrompendo totalmente a passagem, inclusive dos ônibus do transporte escolar, no qual a Escola Municipal Boa Esperança não iniciou o ano letivo de 2017.
Elencamos abaixo os principais danos materiais:

- produtores de leite e da agricultura familiar não estão conseguindo escoar as produções, gerando volumosos prejuízos;

- Alunos perdendo aulas, gerando prejuízos intelectuais imensuráveis;

- Escola sem iniciar o ano letivo escolar 2017;

- Impedimento de trânsito por via terrestre,ocasionando o desconforto de passar por caminhos mais distantes.

- Isolamento de comunidades.

