A Departamento Meio Ambiente, Proteção e Defesa Civil, verificou grandes prejuízos ambientais e econômicos diretos, devido à grande quantidade de árvores arrancadas e quebras com a foça do vento ocorrido na tarde do dia 25/03/2021 e no dia 26/03/2021 no mesmo horário houve outra frente de vento, mas com intensidade menor. Prejuízos indiretos também estão sendo apresentados, uma vez que o conserto das cercas e danos a parte das residências gera gasto de mão de obra, materiais diversos nas propriedades atingidas pelo vento. Gastos adicionais com a aquisição de telhas, madeiramento eletroeletrônicos, estão sendo registradas.
