a) Edificações particulares: 96 unidades habitacionais construídas em madeira, onde 93 foram danificadas e 03 foram destruídas pela força da correnteza e por troncos de árvores trazidas pela inundação que colidiram com peças da infraestrutura dessas residências;
b) Instituições Públicas de Saúde: a Unidade Básica de Saúde do bairro Santa Clara parcialmente danificada;
c) Instituições de Públicas de Ensino: 03 escolas tiveram danos parciais em sua estrutura (piso e na parte inferior das paredes), com custo de recuperação estimado em R$231.820,97, sendo elas: Escola Municipal de Ensino Fundamental Felinto Batista, Centro Educação Infantil Arco Iris e Escola Municipal de Ensino Fundamental Benedito Lima Penelva;
d) Instituições Públicas de Lazer: Praça Beira Rio localizada no bairro da Prainha encontra-se parcialmente danificada com danos em seu calçamento, bancos e em sua jardinagem; 
e) Instituições Públicas Poliesportivas: campos de futebol Barbosão e Tieta com custo estimado de recuperação  de R$288.209,76 reais, localizados nos bairros da Prainha e São Pedro, respectivamente, foram parcialmente danificados;
f) Obras de infraestrutura pública: ramais de escoamento de produção agrícolas, trechos das ruas Ayrton Senna, Avenida Pedro Ladislau e Passarela José Simeão de Souza, além dos muros de arrimos nos bairros, Santa Clara, Prainha e Mina foram parcialmente danificados, com custo estimado de recuperação de R$3.562.188,00;
Os custos estimados e aqui descritos, estão expressos no Relatório da Secretaria Municipal de Infraestrutura.

