Até o presente momento foi contabilizado trinta e três unidades residenciais destruídas em valor médio de R$ 40.000,00 (quarenta mil reais) cada uma, além disso, foram observadas um mil quatrocentos e oitenta unidades residenciais danificadas, cujo prejuízo médio é de aproximadamente R$ 5.000,00 (cinco mil reais) por unidade;
No Balneário CAEMA foram danificadas 08 (oito) barracas de alvenaria destinadas à venda de gêneros alimentícios e bebidas, cujos danos são relacionados à infiltração em suas paredes e perda do telhado por conta da submersão, custando assim cerca de R$ 9.000,00 (nove mil reais) para os reparos necessários;
Na zona rural 04 (quatro) pontes de madeira sofreram danos estruturais cujo prejuízo apresenta valor médio de R$ 40.000,00 (quarenta mil reais), 01 (uma) sofreu perda total custando em média R$ 200.000,00 (duzentos mil reais).
Na zona urbana 02 (duas) pontes de concreto foram danificadas em decorrência das fortes chuvas, estipulando-se R$ 180.000,00 (cento e oitenta mil reais) para fazer os reparos necessários.
Na zona rural também houve desabamento do muro de uma escola no Povoado Pacas em decorrência das fortes chuvas com custo de reparo orçado em R$ 30.000,00 (trinta mil reais)

Durante o período de inverno amazônico (chuvas intensas), grandes danos materiais são constatados em todo o município de São Miguel do Guamá - Pará, todos os anos, quer seja na zona rural, quer seja na zona urbana. Na zona rural, as pontes que a ligam à zona urbana são essenciais ao deslocamento da dessa parte da população, que acaba sendo afetada devido as suas estruturas se encontrarem, de alguma forma, obsoletas, ou seja, com tecnologias ultrapassadas, uma vez que são, em sua maioria, de madeira. Especialmente as pontes de ramais e vicinais foram gravemente afetadas. As fortes chuvas causaram danos a residências, unidades de saúde, unidades de ensino, ruas, estradas vicinais e pontes. Isso se dá devido à falta de infraestrutura adequada em algumas localidades. Através do levantamento e das informações verificadas pela equipe respomsavel, foram apresentados os seguintes valores referentes aos danos e prejuízos causados pelo desastre que atingiu o município: 
16 pontes que foram danificadas e precisam ser recuperadas no valor total de R$ 5.675.732,34; 
20 vias que foram danificadas e precisam ser recuperadas no valor total de R$ R$ 4.323.656,12;
12 estradas vicinais que foram danificadas e precisam ser recuperadas no valor total de R$ R$ 3.878.454,34;
14 unidades de saúde que foram danificadas e precisam de reparos R$ 3.880.000,00; 
5 unidades escolares que foram danificadas e precisam de reparos R$ 2.434.989,00; 
50 casas que foram danificadas e precisam de reparos no valor total R$ 2.250.000,00;

Em visitas realizadas nas áreas afetadas do município de Santa Maria do Pará, a equipe de engenharia realizou o acompanhamento e
levantamento dos prejuízos causados pelas chuvas, onde foram verificadas algumas casas que precisarão ser restabelecidas, estradas com pavimentação que precisarão de reparos, foram identificados rompimentos de estradas, tubos, pontes que foram quebradas, causando dificuldades na trafegabilidade e deslocamento das pessoas. Com todas as informações que foram verificadas, os valores apresentados referentes aos prejuízos causados pelo desastre: 
100 casas que necessitarão de reparos no valor total R$ 3.500.000,00;
400 M2 de pontes que que sofreram danos e precisarão de restabelecimento no valor total de R$ 932.212,00; 
3.000 KM de vias que sofreram danos e precisarão de recuperação de pavimentação no valor total de R$ R$ 300.000,00;
150 KM de estradas vicinais que sofreram danos e precisarão serem requalificadas no valor total de R$ R$ 975.000,00;
